import React, { Component } from 'react';
import '.Css/App.css';
import Routes from "./Routes/Routes";
import Navbar from "./Components/Navbar";


class App extends Component {
  render() {

  return (
    <div className="App">
      <Navbar />
      <Routes />
    </div>
  );
}
}

export default App;
